import React from "react";
import { Link } from "react-router-dom"
import './Header.scss';
import Navbar from 'react-bootstrap/Navbar';

const Header = () => (
    <header className="header">
        <nav className="header__navbar">
            <Navigation />
        </nav>
    </header>
)

const Navigation = () => (
    <>
        <Navbar sticky="top">
            <Link to="/">
                <Navbar.Brand>
                    <span className="header__navbar-brand">Pupcorner</span>
                </Navbar.Brand>
            </Link>
            <Link to="/">
                <Navbar.Brand className="justify-content-end">About Us</Navbar.Brand>    
            </Link> 
        </Navbar>

    </>
)

export default Header;
